matrix::matrix(unsigned int size_x, unsigned int size_y) : data(size_x * size_y, 0.), size_x_val(size_x), size_y_val(size_y) {}

double& matrix::operator()(unsigned int x, unsigned int y) { assert(x < size_x_val && y < size_y_val && "you try to access matrix-element that does not exist"); return data[x*size_y_val + y]; }
const double& matrix::operator()(unsigned int x, unsigned int y)const { assert(x < size_x_val && y < size_y_val && "you try to access matrix-element that does not exist"); return data[x*size_y_val + y]; }

unsigned int matrix::size_x(void)const { return size_x_val; }
unsigned int matrix::size_y(void)const { return size_y_val; }

void matrix::print(void)const {
	std::cout << std::endl;
	for (unsigned int i = 0; i < size_x(); i++) {
		for (unsigned int j = 0; j < size_y(); j++) {
			std::cout <<data[i*size_y() + j] <<",     " ;
		}
		std::cout << std::endl;
	}
}
matrix random_mat(unsigned int r, unsigned int c) {
	std::default_random_engine generator;
	std::normal_distribution<double> distribution(0.0, 1.0);
	matrix random(r, c);
	for (unsigned int i = 0; i < random.size_x(); i++)
	{
		for (unsigned int j = 0; j < random.size_y(); j++)
		{
			random(i, j) = distribution(generator);
		}
	}
	return random;
}

matrix identity_mat(unsigned int r, unsigned int c) {
	
	matrix identity (r, c);
	//for (unsigned int i = 0; i < std::min(identity.size_x(), identity.size_y()); i++)
		for (unsigned int i = 0; i < identity.size_x(); i++)

	{
			identity(i, i) = 1.0;
	}
	return identity;
}

