matrix operator*(const matrix &lhs, double rhs) {
	matrix output = lhs;
	for (unsigned int i = 0; i < lhs.size_x(); i++)
	{
		for (unsigned int j = 0; j < lhs.size_y(); j++)
		{
			output(i, j) *= rhs;
		}	
	}
	return output;
}

void operator*=(matrix &lhs, double rhs) {
	for (unsigned int i = 0; i < lhs.size_x(); i++)
	{
		for (unsigned int j = 0; j < lhs.size_y(); j++)
		{
			lhs(i, j) *= rhs;
		}
	}
	
}

matrix operator*(double lhs, const matrix &rhs) {
	matrix output = rhs;
	for (unsigned int i = 0; i < rhs.size_x(); i++)
	{
		for (unsigned int j = 0; j < rhs.size_y(); j++)
		{
			output(i, j) *= lhs;
		}
	}
	return output;
}

matrix operator/(const matrix &lhs, double rhs) {
	matrix output = lhs;
	for (unsigned int i = 0; i < lhs.size_x(); i++)
	{
		for (unsigned int j = 0; j < lhs.size_y(); j++)
		{
			output(i, j) /= rhs;
		}
	}
	return output;
}

void operator/=(matrix &lhs, double rhs) {
	for (unsigned int i = 0; i < lhs.size_x(); i++)
	{
		for (unsigned int j = 0; j < lhs.size_y(); j++)
		{
			lhs(i, j) /= rhs;
		}
	}
}

matrix operator+(const matrix &lhs, const matrix &rhs) {
	assert(lhs.size_x() == rhs.size_x() && lhs.size_y() == rhs.size_y());
		matrix output(lhs.size_x(), lhs.size_y());
		for (unsigned int i = 0; i < lhs.size_x(); i++)
		{
			for (unsigned int j = 0; j < lhs.size_y(); j++)
			{
				output(i, j) = lhs(i, j) + rhs(i, j);
			}
		}
		return output;
}
void operator+=(matrix &lhs, const matrix &rhs) {
	assert(lhs.size_x() == rhs.size_x() && lhs.size_y() == rhs.size_y());
		for (unsigned int i = 0; i < lhs.size_x(); i++)
		{
			for (unsigned int j = 0; j < lhs.size_y(); j++)
			{
				lhs(i, j) += rhs(i, j);
			}
		}
}

matrix operator-(const matrix &lhs, const matrix &rhs) {
	assert(lhs.size_x() == rhs.size_x() && lhs.size_y() == rhs.size_y());
	matrix output(lhs.size_x(), lhs.size_y());
		for (unsigned int i = 0; i < lhs.size_x(); i++)
		{
			for (unsigned int j = 0; j < lhs.size_y(); j++)
			{
				output(i, j) = lhs(i, j) - rhs(i, j);
			}
		}
		return output;
}
void operator-=(matrix &lhs, const matrix &rhs) {
	assert(lhs.size_x() == rhs.size_x() && lhs.size_y() == rhs.size_y());
		for (unsigned int i = 0; i < lhs.size_x(); i++)
		{
			for (unsigned int j = 0; j < lhs.size_y(); j++)
			{
				lhs(i, j) -= rhs(i, j);
			}
		}
}
void operator==(matrix &lhs, const matrix &rhs) {   
	assert(lhs.size_x() == rhs.size_x() && lhs.size_y() == rhs.size_y());
		for (unsigned int i = 0; i < lhs.size_x(); i++)
		{
			for (unsigned int j = 0; j < lhs.size_y(); j++)
			{
				lhs(i, j) = rhs(i, j);
			}
		}
}
matrix mat_mat_prod(const matrix & lhs, const matrix & rhs) {
	assert(lhs.size_y() == rhs.size_x());
	matrix output(lhs.size_x(), rhs.size_y());
	for (unsigned int i = 0; i < lhs.size_x(); i++)
	{
		for (unsigned int j = 0; j < rhs.size_y(); j++)
		{
			output(i, j) = 0.;
			for (unsigned int k = 0; k < lhs.size_y(); k++)
			{
				output(i, j) += (lhs(i, k) * rhs(k, j));
			}
		}
	}
	return output;
}
matrix transpose(const matrix &m) {
	matrix output(m.size_x(), m.size_y());
	for (unsigned int i = 0; i < m.size_x(); i++) 
	{
		for (unsigned int j = 0; j < m.size_y(); j++)
		{
			output(j, i) = m(i, j);
		}
	}
	return output;
}